import React, { useState } from "react";
import PropTypes from "prop-types";

export default function CardTable({ color }) {
  // Données statiques
  const [users] = useState([
    {
      _id: 1,
      nom: "Dupont",
      prenom: "Jean",
      email: "jean.dupont@example.com",
      tel: "0123456789",
      role: "admin"
    },
    {
      _id: 2,
      nom: "Martin",
      prenom: "Sophie",
      email: "sophie.martin@example.com",
      tel: "0987654321",
      role: "user"
    }
  ]);

  return (
    <div className={`relative flex flex-col min-w-0 break-words w-full mb-6 shadow-lg rounded-lg ${
      color === "light" ? "bg-white" : "bg-blueGray-800 text-white"
    }`}>
      <div className="flex justify-between items-center px-6 py-4 border-b border-gray-200">
        <h3 className={`font-bold text-xl ${
          color === "light" ? "text-blueGray-700" : "text-white"
        }`}>
          Liste des utilisateurs
        </h3>
      </div>

      <div className="overflow-x-auto p-4">
        <table className="w-full text-sm text-left">
          <thead className="text-xs uppercase bg-blueGray-100 text-blueGray-600">
            <tr>
              <th className="px-6 py-3">Nom</th>
              <th className="px-6 py-3">Prénom</th>
              <th className="px-6 py-3">Email</th>
              <th className="px-6 py-3">Téléphone</th>
              <th className="px-6 py-3">Rôle</th>
            </tr>
          </thead>
          
          <tbody className="divide-y divide-blueGray-200">
            {users.map((user) => (
              <tr key={user._id} className="hover:bg-blueGray-50">
                <td className="px-6 py-4">{user.nom}</td>
                <td className="px-6 py-4">{user.prenom}</td>
                <td className="px-6 py-4">{user.email}</td>
                <td className="px-6 py-4">{user.tel}</td>
                <td className="px-6 py-4 capitalize">{user.role}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

CardTable.propTypes = {
  color: PropTypes.oneOf(["light", "dark"]),
};
